output: "tag: browser\n-\naddress bar | go address | go url:\n    browser.focus_address()\n\
  address copy | url copy | copy address | copy url:\n    browser.focus_address()\n\
  \    sleep(50ms)\n    edit.copy()\ngo home:\n    browser.go_home()\n[go] forward:\n\
  \    browser.go_forward()\ngo (back | backward):\n    browser.go_back()\ngo to {user.website}:\n\
  \    browser.go(website)\ngo private:\n    browser.open_private_window()\n\nbookmark\
  \ it:\n    browser.bookmark()\nbookmark tabs:\n    browser.bookmark_tabs()\n(refresh\
  \ | reload) it:\n    browser.reload()\n(refresh | reload) it hard:\n    browser.reload_hard()\n\
  \nbookmark show:\n    browser.bookmarks()\nbookmark bar [show]:\n    browser.bookmarks_bar()\n\
  downloads show:\n    browser.show_downloads()\nextensions show:\n    browser.show_extensions()\n\
  history show:\n    browser.show_history()\ncache show:\n    browser.show_clear_cache()\n\
  dev tools [show]:\n    browser.toggle_dev_tools()\n\n# Legacy [verb noun] commands\
  \ to be removed at a later time\nshow downloads:\n    browser.show_downloads()\n\
  show extensions:\n    browser.show_extensions()\nshow history:\n    browser.show_history()\n\
  show cache:\n    browser.show_clear_cache()\n\n# todo - port to apps\n# navigating\
  \ current page\n# help: key(?)\n# scroll tiny down: key(j)\n# scroll tiny up: key(k)\n\
  # scroll left: key(h)\n# scroll right: key(l)\n# scroll (pop | spring): key(z H)\n\
  # scroll push: key(z L)\n# scroll top: key(gg)\n# scroll (bottom | end): key(G)\n\
  # (scroll half down | mini page): key(d)\n# scroll half up: key(u)\n# [open] link:\
  \ key(f)\n# [open] link new: key(F)\n# copy link: key(y f)\n# copy (address | url):\
  \ key(escape y y)\n# (refresh | reload): browser.reload()\n# view source: key(g\
  \ s)\n# insert mode: key(i)\n# next frame: key(g f)\n# main frame: key(g F)\n# navigating\
  \ to new pages\n# (open | go) (url | history): key(o)\n# (open | go) (url | history)\
  \ new: key(O)\n# (open | go) bookmark: key(b)\n# (open | go) bookmark new: key(B)\n\
  # using find\n# find mode: key(/)\n# next match: key(n)\n# previous match: key(N)\n\
  # navigating history\n# history back: key(H)\n# history forward: key(L)\n# manipulating\
  \ tabs\n# last visited: key(^)\n# dupe tab: key(y t)\n# restore: key(X)\n# search\
  \ tabs: key(T)\n# move to window: key(W)\n"
